                    'c_6v','d_3h','d_6h','t'   ,'t_h' ,'o'   ,'t_d' ,'o_h'};
                pg_code = find(string(pg)==pg_code); %#ok<STRCLQT>
            end

            if from_memory
                % generated with this code:
                %
                % clear;clc;import am_dft.*
