            function MT = get_mt_(r_mt,t_mt,rt)
                
                import am_lib.*
                 
                % define multiplication
                mult_ = @(a,b) [r_mt(a(1),b(1));t_mt(a(2),b(2))];
                %
                nsyms=size(rt,2);
                % construct multiplication table
                for j1 = 1:nsyms
                for j2 = 1:nsyms
                    MT(j1,j2) = member_(mult_(rt(:,j1),rt(:,j2)),rt);
                end
                end
            end

