                    case 'gamma-Al2O3';     uc = create_cell(am_dft.abc2bas(7.9110,'cubic'),               [[1;1;1]*0.37970,[5;5;5]/8,[0;0;0],[1;1;1]*0.15220],        {'O','Al','Al','Al'},227); % ICSD 66558 - CIF has different origin choice
