                    case 'SrRuO3';          uc = create_cell(am_dft.abc2bas([5.5729,7.8518,5.5346],'orth'),[[0;0;0],[0.5;0.25;0.99],[0.55;0.25;0.5],[0.22;0.03;0.21]], {'Ru','Sr','O','O'}, 62); % ICSD 56697
