                   3.048500,  2.286800,  1.546300, 0.867000,13.277100, 5.701100,  0.323900, 32.908900,  0.250800;  % O        
                   3.539200,  2.641200,  1.517000, 1.024300,10.282500, 4.294400,  0.261500, 26.147600,  0.277600;  % F        
