                  11.460400,  7.196400,  6.255600, 1.645500, 0.010400, 1.166200, 18.519400, 47.778400, -9.557400;  % Cl       
                   7.484500,  6.772300,  0.653900, 1.644200, 0.907200,14.840700, 43.898300, 33.392900,  1.444500;  % Ar       
